import React from 'react'

const time = () => {
  const date = new Date();
  console.log(date);
  return (
    <div className='hidden md:flex justify-center items-center gap-2 text-white'>
        <p id="time" className='num tracking-wide font-medium'>{date.getHours() + ':' + date.getMinutes()}</p>
        <div className='flex flex-col'>
          <p id="ampm" className='text-xs font-semibold'>{date.toLocaleTimeString('')}</p>
          <p id="month" className='text-xs font-medium'>September</p>
        </div>
    </div>
  )
}




export default time
